var renderPolitician = function(nickname, top3sent, top3subj, sentiments, subjectivities, tweets) {
	$(".stats-row").hide();
	$(".profile").find("img").attr("src", "/static/" + nickname.toLowerCase() + ".jpg");
	$(".profile").find(".nickname").attr("href", "https://twitter.com/" + nickname).html("@" + nickname);
	plotTweets("allTweets", tweets, nickname);
	plotSentimentWeekly("personalSentimentWeekly", sentiments, subjectivities, nickname);

	$(".profile-row").show();
}

var plotTweets = function(selector, tweets, nick) {
	var dates = [];
	var subjectivities = [];
	var retweets_raw = [];
	var sentiments = [];
	// {"date": "2017-02-15 19:17:59", "subjectivity": 0.9, "name": "realDonaldTrump", "num_retweets": 14433, "sentiment": 0.8}, 
	var max_retweets = 1;
	tweets.map(function(obj){
		dates.push(obj.date);
		subjectivities.push(obj.subjectivity);
		retweets_raw.push(obj.num_retweets);
		sentiments.push(obj.sentiment);
		// console.log(obj.num_retweets)
		if (obj.num_retweets > max_retweets) max_retweets = obj.num_retweets;
	});
	// console.log(dates);
	// console.log(subjectivities);
	// console.log(retweets_raw)
	// console.log(max_retweets);
	// console.log(retweets_raw);
	var retweets = retweets_raw.map(function(v){return Math.ceil(7*Math.log(v*100.0/max_retweets));});
	// console.log(retweets);
	var result = {
		x: dates,
		y: sentiments,
		type: 'scatter',
		marker: {
		    color: 'rgb(0,0,0)',
		    size: retweets
		},
		line: {
			shape: 'spline'
		},
		mode: 'markers',
		// name: "sentiment",
	};
	plotdata = [result]

	var layout = {
		xaxis: {
			showgrid: false,
			zeroline: false,
			type: "date"
		},
		yaxis: {
			showgrid: true,
			fixedrange: true,
			range: [-1.2,1.2],
			zeroline: true,
			title: 'sentiment',
			showticklabels: false
		},
		height: 300,
		autotick: false,
	    ticks: 'inside',
	    tickcolor: 'rgb(100,200,255)',
	    tickwidth: 3,
	    ticklen: 6,
	    tickfont: {
	      family: 'Arial',
	      size: 12,
	      color: 'rgb(82, 82, 82)'
	    },
	    margin: {
	    	l: 30,
	    	r: 30,
	    	t: 30,
	    	b: 40,
	    	pad: 0
	    },
	    paper_bgcolor: 'white',
	    plot_bgcolor: 'white',
	    showlegend: false,
		// legend: {
		// 	orientation: "h"
		// }
	};
	Plotly.newPlot(selector, plotdata, layout);
}

var plotSentimentWeekly = function(selector, sentiments, subjectivities, nick) {
	var dates = [];
	var now = new Date();
	for (i = 0; i < sentiments.length; i++) {
		d = new Date()
		d.setTime(new Date().getTime() - 24*60*60*1000*7*i)
		dates.push(d.toISOString());
	}

	var result1 = {
		x: dates,
		y: sentiments,
		type: 'scatter',
		marker: {
		    color: blue,
		    size: 15
		},
		line: {
			shape: 'spline',
		},
		mode: 'lines+markers',
		name: "sentiment",
	};
	var result2 = {
		x: dates,
		y: subjectivities,
		type: 'scatter',
		marker: {
		    color: 'rgb(255,140,0)',
		    size: 15
		},
		line: {
			shape: 'spline'
		},
		mode: 'lines+markers',
		name: "subjectivity",
	};
	plotdata = [result1, result2]

	var layout = {
		xaxis: {
			showgrid: false,
			zeroline: false,
			type: "date"
		},
		yaxis: {
			showgrid: true,
			fixedrange: true,
			range: [-1,1],
			zeroline: true,
			title: 'sentiment &amp; subjectivity',
			showticklabels: false
		},
		height: 300,
		autotick: false,
	    ticks: 'inside',
	    tickcolor: 'rgb(100,200,255)',
	    tickwidth: 3,
	    ticklen: 6,
	    tickfont: {
	      family: 'Arial',
	      size: 12,
	      color: 'rgb(82, 82, 82)'
	    },
	    margin: {
	    	l: 30,
	    	r: 30,
	    	t: 30,
	    	b: 40,
	    	pad: 0
	    },
	    paper_bgcolor: 'white',
	    plot_bgcolor: 'white',
	    showlegend: true,
		legend: {
			orientation: "h"
		}
	};
	Plotly.newPlot(selector, plotdata, layout);
}